import createReactComponent from '../createReactComponent';
var Clock10 = createReactComponent('Clock10', [['circle', {
  cx: '12',
  cy: '12',
  r: '10',
  key: '1mglay'
}], ['polyline', {
  points: '12 6 12 12 8 10',
  key: 'atfzqc'
}]]);
export default Clock10;
